import React from 'react';
import { Link } from 'react-router-dom';
import About from './About';

class Home extends React.Component {
  render() {

    return(
      <nav className="navigator">
       <Link to={ About }>Sobre</Link>
      </nav>
    );
  }
}

export default Home;
